def miniSkew(text):
    skew = {0:0}
    for i in range(1,len(text)):
        if text[i] == 'G':
            skew[i] = skew[i-1] + 1;
        elif text[i] == 'C':
            skew[i] = skew[i-1] - 1;
        else:
            skew[i] = skew[i-1]
    minvalue = min(skew.values())
    print(minvalue)
    minkey = ''
    for key, value in skew.items():
        if value == minvalue:
            minkey = minkey + ' ' + str(key + 1 )
    return minkey

text = ''

print(miniSkew(text))